func format(input string, tosplit string) []string {
	return strings.Split(input, tosplit)
}

func replaceAtIndex(in string, r string, i int) string {
	out := strings.Split(in, "")
	out[i] = r
	return strings.Join(out, "")
}

func getPassID(low, high rune, letters string, nuum int) int {
	var rows = []int{}
	for i := 0; i < nuum; i++ {
		rows = append(rows, i)
	}
	for _, lol := range letters {
		limit := (len(rows) / 2)
		if lol == low {
			rows = rows[:limit]
		} else {
			rows = rows[limit:]
		}
	}
	return rows[0]
}
func solve(input []string) (int, []int) {
	var ids = []int{}
	var highest = 0
	for _, asd := range input {
		row := getPassID('F', 'B', asd[0:7], 128)
		col := getPassID('L', 'R', asd[7:], 8)
		id := (row * 8) + col
		ids = append(ids, id)
		if id > highest {
			highest = id
		}
	}
	return highest, ids
}

func solve2(input []int) int {
	var ans = 0
	sort.Ints(input)
	for i, num := range input {
		if input[i+1] != num+1 {
			ans = num + 1
			return ans
		}
	}
	return ans
}

func main() {
	format := format(input, "=")
	a1, intput2 := solve(format)
	fmt.Println(a1)
	a2 := solve2(intput2)
	fmt.Println(a2)
}
